import React, { useState, useEffect } from 'react';
import { color, font } from '../../layout/main';
import uuid from 'uuid/v1';

const Title = () => {
  const [queque, setQueque] = useState([]);
  useEffect(()=> {
    const arr = Array(50).fill("GREENPOST'S");
    setQueque(arr);
  },[])
  return(
    <div>
      <ul>
        {
          queque.map((word, i) => <li key={uuid()}>{word}</li>)
        }
      </ul>
      <style jsx >{`
        ul{
          margin: 0;
          color: ${color.prim};
          display: flex;
          width: 150%;
          align-items: center;
          overflow: hidden;
          width: 100%;
        }
        li{
          flex-shrink: 0;
          margin: 0 1rem;
        }
      `}
      </style>
    </div>
  )
}

const Main = () => {
  return(
    <div className="main">
      <Title />
      <style jsx>{`
        div{
          width: 100vw;
          overflow: hidden;
          border: 1px solid red;
        }
      `}
      </style>
    </div>
  )
}

export default Main;
